import ImageCard from "./ImageCard";
import { useSelector } from "react-redux";

function ImageList() {
  const Images = useSelector((state) => state.images);
  console.log(Images);
  return (
    <div>
      <ImageCard />
      Images.map((image) => {<ImageCard key={image.id} image={image} />})
    </div>
  );
}

export default ImageList;
